import React from 'react'
import { Link } from 'react-router-dom'

const Sidebar = () => {
  return (
    <div className="w-64 bg-gray-800 text-white p-4 space-y-4">
      <h2 className="text-xl font-bold">SMART SPIRIT</h2>
      <Link to="/logs" className="block hover:underline">Loglar</Link>
      <Link to="/roles" className="block hover:underline">Roller</Link>
      <Link to="/users" className="block hover:underline">Kullanıcılar</Link>
    </div>
  )
}

export default Sidebar
